  input: 'TEXT,F3XA,,"1) Refunds and offsets to operating expenditures were reported
    on Schedule A, Line 15 for the following: Derek Barnes and Rich Kowalewski paid
    the allocable share of mailing expenses to include an insert into a newsletter
    that was unrelated to federal election activity. Bill Beck and Pamela Wilson repaid
    their travel expenses associated with attending a meeting of the Board of Directors.
    PFLAG repaid the costs of shipping generic publications to PFLAG.  Triangle Marketing
    Service, a commercial list rental broker, remitted list rental income received
    at fair market value. Former employee David Clarenbach pays his monthly health
    insurance premium pursuant to his employment termination agreement.  2) Payments
    made to American Express and other charge card vendors are marked Itemization
    Attached and the itemized disbursements to vendors paid through the payment to
    American Express are reported as memo entries as required.  3) The payment from
    former employee Josh Siegel reported on Schedule A, Line 15, was to pay for his
    health insurance premium pursuant to COBRA.  Health insurance premiums for former
    staff are paid with federal funds and reported on Schedule B, Line 21b.  A transfer
    for the nonfederal share of the Verizon refunds will be reported on the Committee''s
    year end report."'
